import {initCompList} from "../comp-list/reducers";
import * as types from "./types";

export const initialState = {
    initialized: false
}

function appReducer(state = initCompList, {type, payload = null}) {
    switch (type) {
        case types.APP_INIT:
            return {
                ...state,
            }
        case types.APP_INIT_COMPLETED:
            return {
                ...state,
                initialized: true
            }
        default:
            return state
    }
}


export default appReducer
